import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <div class="login-container">
      <div class="login-box">
        <div class="logo-container">
          <img src="assets/bank-logo.png" alt="Bank Logo" class="logo">
        </div>
        <h1>Sign in</h1>
        <p class="subtitle">Sign in with your email address</p>
        
        <form (ngSubmit)="onSubmit()" class="login-form">
          <div class="form-group">
            <input type="email" class="form-control" placeholder="Email address" [(ngModel)]="email" name="email">
          </div>
          
          <div class="form-group">
            <input type="password" class="form-control" placeholder="Password" [(ngModel)]="password" name="password">
          </div>
          
          <a href="#" class="forgot-password">Forgot your password?</a>
          
          <button type="submit" class="btn btn-primary btn-block">Sign in</button>
          
          <div class="signup-link">
            Don't have an account? <a href="#">Sign up now</a>
          </div>
        </form>
      </div>
    </div>
  `,
  styles: [`
    .login-container {
      min-height: 100vh;
      display: flex;
      align-items: center;
      justify-content: center;
      background: linear-gradient(135deg, #002855 0%, #001233 100%);
      padding: 20px;
    }

    .login-box {
      background: white;
      padding: 40px;
      border-radius: 8px;
      box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
      width: 100%;
      max-width: 400px;
      text-align: center;
    }

    .logo-container {
      margin-bottom: 30px;
    }

    .logo {
      max-width: 180px;
      height: auto;
    }

    h1 {
      color: #002855;
      font-size: 24px;
      margin-bottom: 10px;
    }

    .subtitle {
      color: #666;
      margin-bottom: 30px;
    }

    .form-group {
      margin-bottom: 20px;
    }

    .form-control {
      width: 100%;
      padding: 12px;
      border: 1px solid #ddd;
      border-radius: 4px;
      font-size: 14px;
      transition: border-color 0.3s;
    }

    .form-control:focus {
      border-color: #002855;
      outline: none;
      box-shadow: 0 0 0 2px rgba(0, 40, 85, 0.1);
    }

    .forgot-password {
      display: block;
      text-align: right;
      color: #0056b3;
      text-decoration: none;
      margin-bottom: 20px;
      font-size: 14px;
    }

    .btn-primary {
      background-color: #002855;
      border: none;
      padding: 12px;
      width: 100%;
      border-radius: 4px;
      color: white;
      font-weight: 500;
      margin-bottom: 20px;
      cursor: pointer;
      transition: background-color 0.3s;
    }

    .btn-primary:hover {
      background-color: #003875;
    }

    .signup-link {
      color: #666;
      font-size: 14px;
    }

    .signup-link a {
      color: #0056b3;
      text-decoration: none;
      font-weight: 500;
    }

    .signup-link a:hover {
      text-decoration: underline;
    }
  `]
})
export class AppComponent {
  email: string = '';
  password: string = '';

  onSubmit() {
    // Implementar a lógica de login aqui
    console.log('Login attempt:', { email: this.email });
  }
}
